import React from 'react';
import Autosuggest from 'react-autosuggest';

function getSuggestions(value, languages) {
  const inputValue = value.trim().toLowerCase();
  const inputLength = inputValue.length;

  return inputLength === 0 ? [] : languages.filter(lang =>
    lang.name.toLowerCase().slice(0, inputLength) === inputValue
  );
}

function getSuggestionValue(suggestion) { // when suggestion selected, this function tells
  return suggestion.name;                 // what should be the value of the input
}

function renderSuggestion(suggestion) {
  return (
    <span>{suggestion.name}</span>
  );
}


export default class AutoComplete extends React.Component{

  constructor(props) {
    super();
    this.state = {
      value: props.value,
      suggestions: props.suggestions
    };
    this.onChange = this.onChange.bind(this);
    this.onSuggestionsUpdateRequested = props.onSuggestionsUpdateRequested.bind(this);
  }

  componentWillReceiveProps(nextProps) {
    if (nextProps.value) {
      this.setState({
        value: nextProps.value
      });
    }

    if (!nextProps.suggestions || nextProps.suggestions.length === 0) {
      return;
    }
    this.setState({
      suggestions: nextProps.suggestions
    });
  }

  onChange(event, { newValue }) {
    this.setState({
      value: newValue
    });
  }

  render() {
    const { value, suggestions } = this.state;
    const inputProps = {
      placeholder: 'Type a programming language',
      value,
      onChange: this.onChange
    };

    return (
      <Autosuggest suggestions={suggestions} {...this.state.value}
                   onSuggestionsUpdateRequested={this.onSuggestionsUpdateRequested}
                   getSuggestionValue={getSuggestionValue}
                   renderSuggestion={renderSuggestion}
                   inputProps={inputProps} />
    );
  }

}

