    this.addTask = this.addTask.bind(this);
    this.deleteTask = this.deleteTask.bind(this);
}
static propTypes= {
		items:React.PropTypes.array,
		count:React.PropTypes.number,
        title:React.PropTypes.string
}
static defaultProps= {

			items:[],
			count:0,
            title:"Custom Metadata"

}
componentWillMount() {

}
componentDidMount() {

}
state= {
	items:this.props.items,
	count:this.props.items.length,
     title:this.props.title
}
deleteTask(e) {
        var taskIndex = parseInt(e.target.value, 10);
		var props = this.props;
		var items = [];
		props.items.map((task, index) =>
			{if(task.key === taskIndex){
						props.items.splice(index, 1);
						items = props.items;
			}}
        );
		this.props.updateState({
            items: items
        });
}

addTask(e){
		var countVar = this.props.items.length+1;
        var itemsList = this.props.items;
        itemsList = itemsList.concat({"key":countVar});
		this.props.updateState({
            items: itemsList
        });
        e.preventDefault();
}
render(){
        return(
            <div>
                <div>
                    <Heading headingType="h3" value={this.props.title}/>
                </div>
                <div>
                    <MetaDataList items={this.props.items} deleteTask={this.deleteTask} />
                    <form onSubmit={this.addTask}>
                            <button> <span className="pe-icon--plus-circle"></span><span>Add</span></button>
                    </form>
                </div>
            </div>
        );
    }
};

